import React from 'react';
import './BankLogos.css';

const BankLogos = () => {
  const logos = [
    '/assets/bank1-logo.png',
    '/assets/bank2-logo.png',
    '/assets/bank3-logo.png',
    '/assets/bank4-logo.png',
    '/assets/bank5-logo.png',
    '/assets/bank6-logo.png',
    '/assets/bank7-logo.png',
    '/assets/bank8-logo.png',
    '/assets/bank9-logo.png',
    '/assets/bank10-logo.png',
    '/assets/bank11-logo.png',
    '/assets/bank12-logo.png',
    '/assets/bank13-logo.png',
    '/assets/bank14-logo.png',
    '/assets/bank15-logo.png',
  ];

  return (
    <div className="bank-logos">
      <h2 className="section-title">Empanelment - Our Partner Banks</h2>
      <div className="logos-container">
        {logos.map((logo, index) => (
          <img
            key={index}
            src={logo}
            alt={`Bank ${index + 1}`}
            className="bank-logo"
          />
        ))}
      </div>
    </div>
  );
};

export default BankLogos;
